import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import IconButton from '@material-ui/core/IconButton';
import Typography from '@material-ui/core/Typography';
import MenuItem from '@material-ui/core/MenuItem';
import Menu from '@material-ui/core/Menu';
import { NavLink } from 'react-router-dom';
import MenuIcon from '@material-ui/icons/Menu';
import { Button } from '@material-ui/core';

import PropTypes from 'prop-types';
import useScrollTrigger from '@material-ui/core/useScrollTrigger';
import CssBaseline from '@material-ui/core/CssBaseline';

const useStyles = makeStyles((theme) => ({
    grow: {
      flexGrow: 1,
    },
    menuButton: {
      marginRight: theme.spacing(2),
    },
    title: {
      display: 'none',
      [theme.breakpoints.up('sm')]: {
        display: 'block',
      },
    },
    sectionDesktop: {
      display: 'none',
      [theme.breakpoints.up('md')]: {
        display: 'flex',
        justifyContent: 'center',
      },
    },
    sectionMobile: {
      display: 'flex',
      [theme.breakpoints.up('md')]: {
        display: 'none',
      },
    },
  }));

  function ElevationScroll(props) {
    const { children, window } = props;
    // Note that you normally won't need to set the window ref as useScrollTrigger
    // will default to window.
    // This is only being set here because the demo is in an iframe.
    const trigger = useScrollTrigger({
      disableHysteresis: true,
      threshold: 0,
      target: window ? window() : undefined,
    });
  
    return React.cloneElement(children, {
      elevation: trigger ? 4 : 0,
    });
  }
  
  ElevationScroll.propTypes = {
    children: PropTypes.element.isRequired,
    /**
     * Injected by the documentation to work in an iframe.
     * You won't need it on your project.
     */
    window: PropTypes.func,
  };


//image to be displayed on header of Home Page
export default function NavigationBar(props) {
    const classes = useStyles();
    const [mobileMoreAnchorEl, setMobileMoreAnchorEl] = React.useState(null);

    const isMobileMenuOpen = Boolean(mobileMoreAnchorEl);

    const handleMobileMenuClose = () => {
        setMobileMoreAnchorEl(null);
    };

    const handleMobileMenuOpen = (event) => {
        setMobileMoreAnchorEl(event.currentTarget);
    };

    const mobileMenuId = 'primary-search-account-menu-mobile';
    const renderMobileMenu = (
        <Menu
            anchorEl={mobileMoreAnchorEl}
            anchorOrigin={{ vertical: 'top', horizontal: 'right' }}
            id={mobileMenuId}
            keepMounted
            transformOrigin={{ vertical: 'top', horizontal: 'right' }}
            open={isMobileMenuOpen}
            onClose={handleMobileMenuClose}
        >
            <MenuItem><NavLink activeClassName="active" to="/" exact>HOME</NavLink></MenuItem>
            <MenuItem><NavLink activeClassName="active" to="/about" exact>ABOUT US</NavLink></MenuItem>
            <MenuItem><NavLink activeClassName="active" to="/our-team" exact>OUR TEAM</NavLink></MenuItem>
            <MenuItem><NavLink activeClassName="active" to="/join" exact>JOIN US</NavLink></MenuItem>
            <MenuItem><NavLink activeClassName="active" to="/contact" exact>CONTACT</NavLink></MenuItem>
        </Menu>
    );
    return (
      <React.Fragment>
        <CssBaseline/>
        <ElevationScroll {...props}>
        <AppBar position="static">
            <Toolbar>
                <Typography variant="h6" >
                    BECOMING BUSINESSWOMEN
                </Typography>

                <div className={classes.grow} />

                <div className={classes.sectionDesktop}>
                    <Button className={classes.menuButton} color="inherit" >
                    <NavLink activeClassName="active" to="/" exact>HOME</NavLink>
                    </Button>
                    <Button className={classes.menuButton} color="inherit" >
                    <NavLink activeClassName="active" to="/about" exact>ABOUT US</NavLink>
                    </Button>
                    <Button className={classes.menuButton} color="inherit" >
                    <NavLink activeClassName="active" to="/our-team" exact>OUR TEAM</NavLink>
                    </Button>
                    <Button className={classes.menuButton} color="inherit" >
                    <NavLink activeClassName="active" to="/join" exact>JOIN US</NavLink>
                    </Button>
                    <Button className={classes.menuButton} color="inherit" >
                    <NavLink activeClassName="active" to="/contact" exact>CONTACT</NavLink>
                    </Button>
                </div>
                <div className={classes.sectionMobile}>
                    <IconButton
                        aria-label="show more"
                        aria-controls={mobileMenuId}
                        aria-haspopup="true"
                        onClick={handleMobileMenuOpen}
                        color="inherit">
                        <MenuIcon />
                    </IconButton>
                </div>
            </Toolbar>
        </AppBar>
        </ElevationScroll>
      {renderMobileMenu}
      </React.Fragment>
    )
}
